function [diff_vel_v, Twist_normal, Vel_dd_v, Twist_dd_v] = plotCartisenVel(path)    data=csvread(path);    % 读取第1，2，3列，    data(:,4:6) = data(:,4:6)*pi/180;    origin = data(:,1:3);    diff_vel_v =[];    Vel_dd_v =[];    % 计算速度差分     diffFrame = diff(origin);    ddFrame = diff(diffFrame);        % 先构造 frame     for i = 1:length(diffFrame)        norm1 = norm(diffFrame(i,:));        diff_vel_v = [diff_vel_v, norm1];    end            % 先构造 frame     for i = 1:length(ddFrame)        dnorm1 = norm(ddFrame(i,:));        Vel_dd_v = [Vel_dd_v, dnorm1];    end        % 读取第4，5，6列，    x = data(:,4:6);    Tr_v = [];        for i = 1:length(x)        Tr = SE3.convert(poseToMatrix(data(i,:)));        Tr_v = [Tr_v, Tr];    end        Twist_normal = [];    Twist_v =[];    for i = 1:length(x)-1        [theta, w] = trlog(Tr_v(i+1).R'*Tr_v(i).R);        Twist_normal = [Twist_normal,theta];        Twist_v = [Twist_v, theta*w];    end        Twist_dd = diff(Twist_v');    Twist_dd_v= [];    for i = 1:length(Twist_dd)-1        Twist_dd_normal = norm(Twist_dd(i,:));        Twist_dd_v = [Twist_dd_v, Twist_dd_normal];    end    end